	add("benefaction", "{\"term\":\"benefaction\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|benefactiōnem}}, from \u0027benefacere\u0027 (to benefit)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of doing good; a benefit, a blessing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Joyce Crick, translating Sigmund Freud, \u0027The Interpretation of Dreams\u0027, Oxford 2008, p. 70\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We all feel that sleep is a \u0027\u0027benefaction\u0027\u0027 to our psychical life, and the obscure awareness of the popular mind is clearly unwilling to be robbed of its prejudice that the dream is one of the ways in which sleep confers its benefactions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An act of charity; almsgiving\", \"priority\":4}]}, \"synonyms\":{}}");

	add("benefactor", "{\"term\":\"benefactor\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027benefactor\u0027 (he who bestows a favor) from {{m|la|benefaciō||benefit someone}}, from \u0027bene\u0027 (good) + {{m|la|faciō||do, make}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Somebody who gives one a gift. Usually refers to someone who gives money to a charity or another form of organization\", \"priority\":1}]}, \"synonyms\":{}}");

