	add("benefice", "{\"term\":\"benefice\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027benefice\u0027 from Latin \u0027beneficium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Land granted to a priest in a church that has a source of income attached to it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"NYRB, 2001, vol.1, p.323\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If after long expectation, much expense, travel, earnest suit of ourselves and friends, we obtain a small \u0027\u0027benefice\u0027\u0027 at last, our misery begins afresh\u0026amp;nbsp;[…\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Edwin Mullins, \u0027The Popes of Avignon\u0027, Blue Bridge 2008, p.94\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There were as many as one hundred thousand \u0027\u0027benefices\u0027\u0027 offered during the period of his papacy, according to one chronicler and eyewitness\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A favour or benefit\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An estate in lands; a fief\", \"priority\":7}]}, \"synonyms\":{}}");

	add("beneficiary", "{\"term\":\"beneficiary\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From Latin \u0027beneficiarius\u0027 (enjoying a favor, granted a privilege) from \u0027beneficium\u0027 (benefit) perhaps via or influenced by French \u0027bénéficiaire\u0027 (beneficiary) Indirectly, by way of the etymology of the Latin word \u0027beneficium\u0027, the English word \u0027beneficiary\u0027 ultimately has the same origin as the English word \u0027benefactor\u0027, its near antonym.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who benefits or receives an advantage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"You are the lucky \u0027\u0027beneficiary\u0027\u0027 of this special offer\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who benefits from the distribution, especially of an estate\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"If any \u0027\u0027beneficiary\u0027\u0027 does not survive the Settlor for a period of 30 days then the Trustee shall distribute that \u0027\u0027beneficiary\u0027\u0027’s share to the surviving \u0027\u0027beneficiaries\u0027\u0027 by right of representation\", \"priority\":4}]}, \"synonyms\":{}}");

	add("beneficiation", "{\"term\":\"beneficiation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The reduction in size of particles of ore before further processing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("benefit", "{\"term\":\"benefit\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Late Middle english (1100-1500) \u0027benefytt\u0027 \u0027benefett\u0027 alteration (due to Latin \u0027bene-\u0027 of Middle english (1100-1500) \u0027benfet\u0027 \u0027bienfet\u0027 \u0027bienfait\u0027 (good or noble deed) from Anglo-norman \u0027benfet\u0027 (well-done) Middle french (ca. 1400-1600) \u0027bienfait\u0027 from Old french (842-ca. 1400) \u0027bienfet\u0027 \u0027bienfait\u0027 (foredeal, favour) from past participle of Old french (842-ca. 1400) \u0027bienfaire\u0027 (to do good, do well) from \u0027bien\u0027 (well) + \u0027faire\u0027 (to do) modelled after Latin \u0027benefactum\u0027 (good deed) More at {{l/en|benefactor}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An advantage, help, sake or aid from something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d5|passage\u003dWhen this conversation was repeated in detail within the hearing of the young woman in question, and undoubtedly for his \u0027\u0027benefit\u0027\u0027, Mr. Trevor threw shame to the winds and scandalized the Misses Brewster then and there by proclaiming his father to have been a country storekeeper\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A payment made in accordance with an insurance policy or a public assistance scheme\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A performance, etc, given to raise funds for some cause\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"beneficence; liberalit\", \"priority\":5}]}, \"synonyms\":{}}");

