	add("benito", "{\"term\":\"benito\", \"etymology\":{\"influencers\":[], \"languages\":[\"Spanish\"], \"text\":\"based on \u0027Benedictus\u0027, blessed, well spoken of\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of derivation; English equivalent: \u0027\u0027Benedict\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A card game played using a deck of 1990 MLB all-star playing cards\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An unincorporated community in Californi\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An unincorporated community in Kentuck\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A village in ManitobaCategory:en:VillagesCategory:en:CaliforniaCategory:en:KentuckyCategory:en:Manitoba\", \"priority\":5}]}, \"synonyms\":{}}");

