	add("benne", "{\"term\":\"benne\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Malay\", \"Wolof\"], \"text\":\"From Malay \u0027tr\u003dbene\u0027 or possibly from Wolof or Maninka.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sesame\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"benne\u0027\u0027 oil; \u0027\u0027benne\u0027\u0027 seed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Carole Marsh, \u0027The Kitchen House: How Yesterday\u0027s Black Women Created Today\u0027s Most Popular \u0026amp; Famous American Foods!\u0027, [http://books.google.com.au/books?id\u003dnbWKskFqYmoC\u0026amp;pg\u003dPT8\u0026amp;dq\u003d%22benne%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dtP6eU_68CMTIkwWBvIDoAg\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22benne%22\u0026amp;f\u003dfalse page 15\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Benne\u0027\u0027 (sesame) seeds were secretly brought to America on the slave ships by black women who had used them in their native cooking. \u0027\u0027Benne\u0027\u0027 seed cookies and candy were made by black cooks in Charleston and other lowcountry South Carolina locations\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Frederick C. Knight, \u0027Working the Diaspora: The Impact of African Labor on the Anglo-American World, 1650—1850\u0027, [http://books.google.com.au/books?id\u003dX4Fbm4GB9QoC\u0026amp;pg\u003dPA62\u0026amp;dq\u003d%22benne%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVQufU-X0F4KGkAW3tYD4Cw\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22benne%22\u0026amp;f\u003dfalse page 62\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"For exampl, Rosanna Williams recounted that her African-born father would \u0026quot;plant mostly \u0027\u0027benne\u0027\u0027 and rice.\u0026quot; Emma Hunter also remembered that her grandmother planted \u0027\u0027benne\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, David S. Shields, \u0027Chapter 3: Prospecting for Oil\u0027, John T. Edge, Elizabeth S. D. Engelhardt, Ted Ownby (editors), \u0027The Larder: Food Studies Methods from the American South\u0027, [http://books.google.com.au/books?id\u003dsWn-AAAAQBAJ\u0026amp;pg\u003dPA65\u0026amp;dq\u003d%22benne%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dtP6eU_68CMTIkwWBvIDoAg\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22benne%22\u0026amp;f\u003dfalse page 65\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A window on the small-scale world of sesame oil production and \u0027\u0027benne\u0027\u0027 cake livestock feeding is found in the pages of Thomas Walter Peyre\u0027s plantation journal (1834–59) at the South Carolina Historical Society.African Anerican farming of \u0027\u0027benne\u0027\u0027 can be imputed only by anecdotal reports, yet numerous records attest to \u0027\u0027benne’s\u0027\u0027 importance in the slave diet. Indeed, a complex \u0027\u0027benne\u0027\u0027 cookery adapted from African practices was recorded\", \"priority\":11}]}, \"synonyms\":{}}");

	add("benocclusion", "{\"term\":\"benocclusion\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Probably coined by Simeon Hayden Guilford \u0027ante\u0027 1905: Latin \u0027bene\u0027 + \u0027occlusion\u0027 (alignment of the teeth in closed jaws) after \u0027malocclusion\u0027 (misalignment of the upper and lower sets of teeth)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Normal (alignment) of the teeth when the jaws are closed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1905\u0027\u0027, Simeon Hayden Guilford, \u0027Orthodontia; or, Malposition of the Human Teeth\u0027, 4th ed., [http://books.google.co.uk/books?ei\u003drP9JUcObBqWq0QWJ-YGQDQ\u0026amp;id\u003disbRAAAAMAAJ\u0026amp;dq\u003d%22benocclusion%22\u0026amp;q\u003d%22benocclusion%2C+or+normal+occlusion%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"search_anchor page 33\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Benocclusion\u0027\u0027…is well illustrated by Fig. 11 which represents the teeth of a Caucasian in a state of contact or rest\", \"priority\":4}]}, \"synonyms\":{}}");

