	add("benzaldehyde", "{\"term\":\"benzaldehyde\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|benz|aldehyde|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chemical compound (C\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;5\u0026lt;/sub\u0026gt;CHO) consisting of a benzene ring with an aldehyde substituent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of various derivatives of benzaldehyde\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"benzaldehydes\u0027\u0027 with polar substituents\", \"priority\":3}]}, \"synonyms\":{}}");

