	add("benzedrine", "{\"term\":\"benzedrine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"trade name of the racemic mixture of amphetamine (\u0027dl\u0027-amphetamine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027, w:Sylvia Sylvia Plath, \u0027w:The Bell The Bell Jar\u0027, Faber and Faber, page 118\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Then I would be way ahead when college started at the end of September, and able to enjoy my last year instead of swotting away with no make-up and stringy hair, on a diet of coffee and \u0027\u0027benzedrine\u0027\u0027, the way most of the seniors taking honours did, until they finished their thesis\", \"priority\":3}]}, \"synonyms\":{}}");

	add("benzene", "{\"term\":\"benzene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A technical term in chemistry, adopted in English in 1835 as \u0027benzine\u0027 (\u0027benzene\u0027 from 1872), from German \u0027Benzin\u0027, which was coined in 1833 by Eilhardt Mitscherlich based on \u0027Benzoesäure\u0027 \u0026quot;benzoic acid\u0026quot;, plus the technical ending \u0027-ene\u0027 (German \u0027-in\u0027) denoting hydrocarbons.benzoic in turn is an adjective formed from benzoin, originally a term for a balsamic resin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An aromatic hydrocarbon of formula C\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt; whose structure consists of a ring of alternate single and double bonds\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2013/4/solvents-ethanol-car-crashes-amp-tolerance Solvents, Ethanol, Car Crashes \u0026amp; passage\u003dFurthermore, this increase in risk is comparable to the risk of death from leukemia after long-term exposure to \u0027\u0027benzene\u0027\u0027, another solvent, which has the well-known property of causing this type of cancer\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sometimes used in place of the phenyl group\", \"priority\":3}]}, \"synonyms\":{}}");

	add("benzile", "{\"term\":\"benzile\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A yellowish crystalline substance, C\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;5\u0026lt;/sub\u0026gt;.CO.CO.C\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;5\u0026lt;/sub\u0026gt;, formed from benzoin by the action of oxidizing agents, and consisting of a doubled benzoyl radical\", \"priority\":1}]}, \"synonyms\":{}}");

	add("benzocaine", "{\"term\":\"benzocaine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|benzo|caine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A local anesthetic commonly used as a topical pain reliever\", \"priority\":1}]}, \"synonyms\":{}}");

	add("benzodiazepine", "{\"term\":\"benzodiazepine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|benzo|diazepine|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a class of psychoactive drugs, structured upon diazepine, used in the treatment of anxiety, insomnia and other related disorders\", \"priority\":1}]}, \"synonyms\":{}}");

