	add("benzoin", "{\"term\":\"benzoin\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Spanish\", \"middle french (ca. 1400-1600)\", \"Italian\", \"Portuguese\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027benjoin\u0027 from Spanish \u0027benjuí\u0027 Portuguese \u0027beijoin\u0027 Italian \u0027benzoi\u0027 from Arabic \u0027لُبَان جَاوِيّ|lang\u003dar\u0027 () The initial \u0027lu\u0027 was probably lost because it was taken as the definite article in Romance. Compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A resinous substance, dry and brittle, obtained from the , a tree of Sumatra, Java, etc., having a fragrant odor, and slightly aromatic taste. It is used in the preparation of benzoic acid, in medicine, and as a perfume\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An aromatic hydroxy ketone, \u00272-hydroxy-1,2-di(phenyl)ethanone\u0027, synthesized from benzaldehyde; any derivative of this compound\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The spicebush, \u0027Lindera benzoin\", \"priority\":3}]}, \"synonyms\":{}}");

